import { useState } from "react";
import "./Dashboard.css";

function Dashboard() {
  const [activeTab, setActiveTab] = useState("Home");

  return (
    <div className="android-app">
      {/* Top App Bar */}
      <div className="appbar">
        <div className="app-title">
          <div className="logo">ES</div>
          <span>EventSphere</span>
        </div>
        <button
          className="icon-btn"
          onClick={() => alert("No notifications")}
        >
          üîî
        </button>
      </div>

      {/* Content */}
      <div className="content">
        <h3>Hi Student üëã</h3>
        <p className="subtitle">Explore college events</p>

        {/* ANDROID SEARCH */}
        <div className="search-android">
          <span className="search-icon">üîç</span>
          <input type="text" placeholder="Search events" />
        </div>

        {/* Stats */}
        <div className="stats">
          <div className="stat">Upcoming <b>3</b></div>
          <div className="stat">Registered <b>5</b></div>
          <div className="stat">My Tickets <b>2</b></div>
          <div className="stat">Announcements <b>4</b></div>
        </div>

        {/* Events Header */}
        <div className="section">
          <h4>Upcoming Events</h4>
          <button
            className="link-btn"
            onClick={() => alert("See all events")}
          >
            See all
          </button>
        </div>

        {/* Events */}
        <div className="events">
          <div className="event-card">
            <img src="https://images.unsplash.com/photo-1521737604893-d14cc237f11d" />
            <h5>Tech Innovators Summit</h5>
            <p>Hosted by CSE Department</p>
            <small>Mar 22 ¬∑ 6:00 PM</small>
            <button onClick={() => alert("Registered")}>Register</button>
          </div>

          <div className="event-card">
            <img src="https://images.unsplash.com/photo-1514516870926-206f6f1b9fa3" />
            <h5>Campus Cultural Fest</h5>
            <p>Student Council</p>
            <small>Apr 05 ¬∑ 7:30 PM</small>
            <button className="outline">Register</button>
          </div>
        </div>
      </div>

      {/* ANDROID BOTTOM NAV */}
      <div className="bottom-nav">
        {["Home", "Events", "My Events", "Profile"].map((tab) => (
          <div
            key={tab}
            className={`nav-item ${activeTab === tab ? "active" : ""}`}
            onClick={() => setActiveTab(tab)}
          >
            <span>
              {tab === "Home" && "üè†"}
              {tab === "Events" && "üìÖ"}
              {tab === "My Events" && "üéü"}
              {tab === "Profile" && "üë§"}
            </span>
            <small>{tab}</small>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
